new Vue({
    el: '#vue',    
    data: {
        parroquia: '',
        parroquias: [],
        municipio: '',
        municipios: [],
    	newNombres: '',
        newCedula: '',
        newEdad: '',
        newParentezco: '',
        newInstruccion: '',
        newMunicipio: '',
        newParroquia: '',
        newDireccion: '',
        newCentroVotacion: '',
        newBeneficiarioMision: '',
    	fillFamiliar: {
            'cedula_persona': cedula = $('#cedula').val(),
            'id': '',
            'nombres': '',
            'cedula': '',
            'edad': '',
            'parentezco': '',
            'instruccion': '',
            'municipio': '',
            'parroquia': '',
            'direccion': '',
            'centro_votacion': '',
            'beneficiario_mision': ''},
    	errors: [],
    	offset: 3,
    },
    methods: {

    	deleteFamiliar: function(){
    		var url = 'familiars/delete/' + sessionStorage.editId;
    		axios.delete(url).then(response => { //Eliminamos
                $('#modal-eliminar-familiar').modal('hide');
    			toastr.success('El registro se ha eliminado correctamente.'); //enviamos mensaje
                familiarsreload()
    		});
    	},

        getParroquias: function(id_municipio){
            var urlParroquias = 'parroquias/' + id_municipio;
            axios.get(urlParroquias).then( response => {
                this.parroquias = response.data
            });
        },

        getMunicipios: function(){
            var urlMunicipios = 'municipios/';
            axios.get(urlMunicipios).then( response => {
                this.municipios = response.data
            });
        },

        /*getKeeps: function(page){
            var urlKeeps = 'tasks?page='+page;
            axios.get(urlKeeps).then(response => {
                this.keeps = response.data.tasks.data,
                this.pagination = response.data.pagination
            });
        },*/

    	editFamiliar: function(){
            this.getMunicipios();
            this.getParroquias(sessionStorage.editMunicipio);
            $('#modal-opciones-familiar').modal('hide');
            $('#modal-editar-familiar').modal('show');
    		this.fillFamiliar.id          = sessionStorage.editId;
    		this.fillFamiliar.nombres     = sessionStorage.editNombres;
            this.fillFamiliar.cedula      = sessionStorage.editCedula;
            this.fillFamiliar.edad        = sessionStorage.editEdad;
            this.fillFamiliar.parentezco  = sessionStorage.editParentezco;
            this.fillFamiliar.instruccion = sessionStorage.editInstruccion;
            this.fillFamiliar.municipio    = sessionStorage.editMunicipio;
            this.fillFamiliar.parroquia    = sessionStorage.editParroquia;
            this.fillFamiliar.direccion    = sessionStorage.editDireccion;
            this.fillFamiliar.centro_votacion = sessionStorage.editCentroVotacion;
            this.fillFamiliar.beneficiario_mision = sessionStorage.editBeneficiarioMision;

    	},

    	updateFamiliar: function(id){
    		var url = 'familiars/edit/' + id;
    		axios.put(url, this.fillFamiliar).then(response => {
    			//this.getKeeps();
    			fillFamiliar= {
                    'id': '',
                    'nombres': '',
                    'cedula': '',
                    'edad': '',
                    'parentezco': '',
                    'instruccion': '',
                    'municipio': '',
                    'parroquia': '',
                    'direccion': '',
                    'centro_votacion': '',
                    'beneficiario_mision': ''},
    			this.errors =[];
                familiarsreload()
    			$('#modal-editar-familiar').modal('hide');
    			toastr.success('Familiar actualizado con exito.');
    		}).catch(error => {
    			this.errors = error.response.data;
    		}); //put se usa para una actualizacion de datos
    	},

    	createFamiliar: function(){
            cedula = $('#cedula').val();
    		var url = '/familiars/store';
    		axios.post(url, {
                cedula_persona: cedula,
    			nombres: this.newNombres,
                cedula: this.newCedula,
                edad: this.newEdad,
                parentezco: this.newParentezco,
                instruccion: this.newInstruccion,
                municipio: this.newMunicipio,
                parroquia: this.newParroquia,
                direccion: this.newDireccion,
                centro_votacion: this.newCentroVotacion,
                beneficiario_mision: this.newBeneficiarioMision,

    		}).then(response => {
    			//this.getKeeps(); //lista de nuevo con la nueva tarea creada
    			this.newNombres = ''; //deja el formulario keep sin nada
                this.newCedula = '';
                this.newEdad = '';
                this.newParentezco = '';
                this.newInstruccion = '';
                this.newMunicipio = '';
                this.newParroquia = '';
                this.newDireccion = '';
                this.newCentroVotacion = '';
                this.newBeneficiarioMision = '';
    			this.errors = []; //deja los errores vacios
    			$('#modal-agregar-familiar').modal('hide');
                familiarsreload()
    			toastr.success('Familiar agregado con exito.');
    		}).catch(error => {
    			this.errors = error.response.data.errors;
    		});
    	}
    }
});


function t_familiars(){
    cedula = $('#cedula').val();

    $('#t_familiars').DataTable().destroy();
    var t_familiars= $('#t_familiars').DataTable({
        processing: true,
        serverSide: true,
        ajax: "/familiars/list/" + cedula,
        columns: [
            { data: 'nombres' },
            { data: 'cedula' },
            { data: 'edad' },
            { data: 'parentezco'  },
            { data: 'instruccion' },
            { data: 'municipio' },
            { data: 'parroquia' },
            { data: 'direccion' },
            { data: 'centro_votacion' },
            { data: 'beneficiario_mision' },
        ],
    });

    $('#t_familiars tbody').on( 'click', 'tr', function () {
        var data = t_familiars.row(this).data() ;
        $('#modal-opciones-familiar').modal('show');
        $('#title-opciones-familiar').html('Seleccione una opci√≥n para: <strong>'+data['nombres']+'</strong>');
        sessionStorage.setItem('editId', data['id']);
        sessionStorage.setItem('editNombres', data['nombres']);
        sessionStorage.setItem('editCedula', data['cedula']);
        sessionStorage.setItem('editEdad', data['edad']);
        sessionStorage.setItem('editParentezco', data['parentezco']);
        sessionStorage.setItem('editInstruccion', data['instruccion']);
        sessionStorage.setItem('editMunicipio', data['municipio']);
        sessionStorage.setItem('editParroquia', data['parroquia']);
        sessionStorage.setItem('editDireccion', data['direccion']);
        sessionStorage.setItem('editCentroVotacion', data['centro_votacion']);
        sessionStorage.setItem('editBeneficiarioMision', data['beneficiario_mision']);
    });
}

function familiarsreload(){
    $('#t_familiars').DataTable().ajax.reload();
}

