$(document).ready(function(){

    $('#btn-print-carnet').click(function(){
        //imagenes
        var carnetFront = 'data:image/png;base64,';
        var carnetBack = 'data:image/png;base64,';
        
        cedula          = $('#cedulaCarnet').val();
        nombres         = $('#nombresCarnet').val();
        municipio       = $('#municipioCarnet').val();
        municipio = municipio.substring(4)
        responsabilidad = $('#responsabilidadCarnet').val();
        estructura      = $('#estructuraCarnet').val();
        imagen          = $('#imagen').val();
        qrcode          = $('#qrcodepng').attr('src');
        uuid            = $('#uuid').val();

        var doc = new jsPDF('p','mm',[54, 86]);

        
        doc.addImage(carnetFront, 'PNG', 0, 0, 54, 86);
        doc.addImage(imagen, 'PNG', 13, 20, 29, 35);
        doc.setFont('helvetica');
        doc.setFontType('bold');
        doc.setFontSize(8);
        doc.setTextColor(0,0,0);

        doc.text(27, 63, nombres, null, null, 'center');
        doc.text(13, 71, cedula, null, null, 'center');
        doc.text(40, 71, municipio, null, null, 'center');


        doc.text(27,82, responsabilidad+' - '+estructura, null, null, 'center');


        doc.addPage();
        doc.addImage(carnetBack, 'PNG', 0, 0, 54, 86);
        doc.addImage(qrcode, 'PNG', 13, 40, 31, 29);

        doc.setTextColor(255,255,255);
        doc.setFontSize(7);
        doc.text(uuid, 6, 72);
        doc.save(cedula+'.pdf')

    });


    $('#banco').change(function(e){
        e.preventDefault();
        var cod = $(this).find('option:selected').attr('value');
        $('#cuenta').val(cod);
    });


    oTable = $('#users').DataTable({
        processing: true,
        serverSide: true,
        ajax: "/users/list",
        columns: [
            { data: 'id', name: 'id' },
            { data: 'name', name: 'name' },
            { data: 'cedula', name: 'cedula' },
            { data: 'telefono', name: 'telefono' },
            { data: 'email', name: 'email' },
        ]
    });

    $('.cedula').mask('S0000000000', {
        'translation': {
            S: {pattern: /[vepjgrcVEPJGRC]/},
            0: {pattern: /[0-9]/}
        }
        ,onKeyPress: function (value, event) {
            event.currentTarget.value = value.toUpperCase();
        }
    });

    $('.banco-cuenta').mask('0000-0000-00-0000000000', {
        'translation': {            
            0: {pattern: /[0-9]/}
        }
    });

    $('.telefono').mask('1200-0000000', {
        'translation': {
            0: {pattern: /[0-9]/},
            1: {pattern: /[0]/},
            2: {pattern: /[2,4]/},
        },
    });


    $('#f_nacimiento').datetimepicker({
        viewMode: 'years',
        format: 'YYYY-mm-DD',        
    });

});

